pragma solidity 0.8.0;

contract UnderAndOverflow {
    uint8 myNumber = 100;

    // 1 0000 0000
    function add156() external view returns (uint8) {
        return myNumber + 156;
    }

    function subtract101() external view returns (uint8) {
        return myNumber - 101;
    }
}

